import React from 'react';
import styled from 'styled-components';
// import ChildItemCatalog from './ChildItemCatalog';

const Title = styled.div``;

const ItemCatalog = ({ catalogs }) => {
  return (
    <div>
      <Title>{catalogs}</Title>
      <h1>hello</h1>
    </div>
  );
};

export default ItemCatalog;
